const App = () =>{

    const [n , set] = useState();

    const get = () => {
        set(Date=new Date().toLocaleDateString);
    }

    return(
        <>
        <h1>Todays Time is {n}</h1>
        <h1>Todays Date is {}</h1>
        <button onClick={get}>click</button>
        </>
    )
}
export default App;
